"""## Data Preprocessing

## **PyTorch Tensor**

Tensors are the basic data structure used by neural networks in Pytorch.

 A PyTorch Tensor is conceptually identical to a numpy array: a Tensor is an n-dimensional array, and PyTorch provides many functions for operating on these Tensors. Behind the scenes, Tensors can keep track of a computational graph and gradients, but theyre also useful as a generic tool for scientific computing.

Also unlike numpy, PyTorch Tensors can utilize GPUs to accelerate their numeric computations. To run a PyTorch Tensor on GPU, you simply need to cast it to a new datatype.
"""

import PIL

transform = transforms.Compose([transforms.ToTensor(),
                                 transforms.RandomHorizontalFlip(p=0.5),
                                 transforms.RandomVerticalFlip(p=0.5),
                                 transforms.GaussianBlur(3, sigma=(0.1,2.0)),
                                 transforms.RandomRotation(45, resample=PIL.Image.BILINEAR)])

"""#Defining the training and testing set

"""

trainset = datasets.FashionMNIST('./data', download=True, train=True, transform=transform)
testset = datasets.FashionMNIST("./", download=True,train=False,transform=transform)



"""#Defining trainloader and testloader
The transforms operations are applied to your original images at every batch generation. 

So your dataset is left unchanged, only the batch images are copied and transformed every iteration.
"""

trainloader = torch.utils.data.DataLoader(trainset, batch_size = 65, shuffle = True)
testloader = torch.utils.data.DataLoader(testset, batch_size = 65, shuffle = True)

len(testset)

"""## **Visualizing the Training Images**"""

dataiter = iter(trainloader)
images,labels = dataiter.next()

print(images.shape)
